  \"trace-elements-and-organochlorines-in-sediments-and-fish-from-missouri-river-reservoirs-in\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"The Federal Energy Regulatory Commission
  (FERC) is currently reviewing the application submitted by the Montana Power Company
  (MPC) for relicensing their hydroelectric dams on the Missouri and Madison Rivers
  in Montana. As part of the application process, MPC has proposed to monitor water
  quality in the Missouri-Madison River system. The monitoring plan was prepared by
  an interagency technical committee. The plan is designed to monitor the water quality
  and associated biological health at hydro-electric projects on the Madison-Missouri
  River system. This report addresses the component of the monitoring plan designed
  to establish baseline biocontaminant data by measuring trace elements and organochlorine
  compounds in sediments, algae, aquatic macroinvertebrates, and fish in the reservoirs
  and river segments of the system. MPC and the Montana Department of Fish, Wildlife
  and Parks (MDFWP) collected sediment, aquatic invertebrate, and fish samples from
  sites associated with the MPC reservoirs on the Missouri and Madison Rivers in 1994
  and 1995 and analyzed them for trace elements and organochlorine compounds. As part
  of the cooperative nature of the interagency technical committee, MPC requested
  that the U.S. Fish and Wildlife Service's (USFWS) Montana Ecological Services Office
  assist in the interpretation of those analytical results. In this report, we present
  and interpret the MPC data and compare them with results of other studies conducted
  in the Missouri River drainage and elsewhere in Montana.\",\n\t\"license_title\":
